  Elizabeth b. at Gisborne. Address: 5 Gordon Avenue, Christchurch.
  Elizabeth was educated at Nga Tawa School. She was a Karitane nurse (1944-54) then a librarian with the
  National Library of New Zealand, driving one of their book vans around the South Island for ten years.
  She was a library adviser for the next 18 years, and also relieved on the library vans when necessary
  until she retired in 1988. Elizabeth has a tin trunk containing family letters and memorabilia from the
  early 1800's plus a collection of historical photographs.
